import getFullResponseFromAPI from './1-promise';

// Test the true case
console.log('Testing with true:');
const successPromise = getFullResponseFromAPI(true);
console.log('Promise object:', successPromise);

successPromise
  .then(result => {
    console.log('✅ Success result:', result);
  })
  .catch(error => {
    console.log('❌ Unexpected error:', error.message);
  });

// Test the false case
console.log('\nTesting with false:');
const failPromise = getFullResponseFromAPI(false);
console.log('Promise object:', failPromise);

failPromise
  .then(result => {
    console.log('✅ Unexpected success:', result);
  })
  .catch(error => {
    console.log('❌ Expected error:', error.message);
  });

// Test both with async/await
async function testBoth() {
  console.log('\n--- Testing with async/await ---');

  try {
    const result = await getFullResponseFromAPI(true);
    console.log('✅ Async success:', result);
  } catch (error) {
    console.log('❌ Async error (unexpected):', error.message);
  }

  try {
    const result = await getFullResponseFromAPI(false);
    console.log('✅ Async success (unexpected):', result);
  } catch (error) {
    console.log('❌ Async error (expected):', error.message);
  }
}

testBoth();

