import handleResponseFromAPI from './2-then';

console.log('--- Testing with resolved promise ---');
const resolvedPromise = Promise.resolve();
handleResponseFromAPI(resolvedPromise)
  .then(result => {
    console.log('✅ Resolved result:', result);
  });

console.log('\n--- Testing with rejected promise ---');
const rejectedPromise = Promise.reject('Some error');
handleResponseFromAPI(rejectedPromise)
  .then(result => {
    console.log('✅ Rejection handled, result:', result);
    console.log('Is it an Error?', result instanceof Error);
  });

console.log('\n--- Testing with delayed resolved promise ---');
const delayedPromise = new Promise(resolve => {
  setTimeout(() => resolve('delayed success'), 1000);
});
handleResponseFromAPI(delayedPromise)
  .then(result => {
    console.log('✅ Delayed result:', result);
  });

console.log('\n--- Testing with delayed rejected promise ---');
const delayedRejection = new Promise((resolve, reject) => {
  setTimeout(() => reject('delayed error'), 1500);
});
handleResponseFromAPI(delayedRejection)
  .then(result => {
    console.log('✅ Delayed rejection handled, result:', result);
    console.log('Is it an Error?', result instanceof Error);
  });
